import Header from'../components/Header'
import Basket from'../components/Basket'
import ShoppingList from '../components/ShoppingList'

function Home() {
  return (
      <div>
          <Header/>
          <div className="flex">
              <div className="fixed shadow-lg h-full w-1/4 bg-secondary overflow-auto">
                  <Basket/>
              </div>
              <div className="w-3/4 ml-auto">
                  <ShoppingList/>
              </div>
          </div>
      </div>
  )
      ;
}

export default Home;
